import {connect} from "react-redux";
import React from 'react'
import Post from '../containers/Post';

function PostList({allPosts}) {

    return (
        <ul>
            {allPosts.map(post => (
                <Post />
            ))}
        </ul>
    );
}

export default connect()(PostList)
